import React, { Component } from 'react';
import white_logo from '../img/WhiteLogo.png';

class Side extends Component {
  render() {
    return (
      <div className="side">
        <img src={white_logo} alt="Logo" className="side-logo" />
        <nav>
          <ul>
            {this.renderTabs()}
          </ul>
        </nav>
      </div>
    );
  }
}

export default Side;
